import headerbg from "./scenic-view-of-forest-during-night-time-1252869.jpg";

let styles = {
    header: {
        backgroundImage:'url('+headerbg+')',
        width:'100%',
        height: '10%',
        minHeight: '12em',
        backgroundSize:'scale'
    },
};

export default styles;
